import React from 'react';
import { Link } from 'react-router-dom';
import { Nav, Navbar } from 'react-bootstrap';
import './Navbar.css';

const Header = () => {
    const listMenu = ['HOME', 'FINAL PROJECT']

    return (
        <div className="navbar navbar-expand-lg navbar-dark shadow-5-strong" fixed="top">
            <div className="container">
                <ul className="mr-auto">
                    <img src="img/logo.png" alt="" title="" height="40px" width="40px"></img>
                </ul>
                <ul className="ml-auto">
                    <Link to="/"><p>HOME</p></Link>
                    <Link to="/final_project"><p>FINAL PROJECT</p></Link>
                </ul>
            </div>
        </div>
    )
}

export default Header;
